import { createRoot } from 'react-dom/client';
import './index.css';
import * as React from 'react';
import { useEffect } from 'react';

import { DatePickerComponent } from '@syncfusion/ej2-react-calendars';

const Range = () => {
    const minDate = new Date(new Date().getFullYear(), new Date().getMonth(), 7);
    const maxDate = new Date(new Date().getFullYear(), new Date().getMonth(), 27);
    const dateValue = new Date(new Date().getFullYear(), new Date().getMonth(), 14);
    return (<div className='control-pane'>
            <div className='control-section'>
                <div className='datepicker-control-section'>
                    <DatePickerComponent id="calendar" min={minDate} max={maxDate} value={dateValue}></DatePickerComponent>
                </div>
            </div>
        </div>);
};
export default Range;

const root = createRoot(document.getElementById('sample'));
root.render(<Range />);
